import Contact from "./components/Contact";
import Hero from "./components/Hero";
import Navbar from "./components/Navbar";
import Notice from "./components/Notice";
import "./styles.css";

export default function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      <Notice />
      <Contact />
    </div>
  );
}
